function Myplants() {

    return (
        <>
        <MyplantsTab />


        <div className= "main"> 
          <div className="main-txt"> 
          <Button id="myplantsbtn" variant="outline-secondary" href="/myplantswrite">등록하기</Button>
          </div>
        </div>

        </>
    )
}

export default Myplants;
